import React from 'react';
import { Route, Routes } from 'react-router-dom';
import ProfileHeader from './ProfileHeader';
import TopArtists from './TopArtists';
import Playlists from './Playlists';
import Sidebar from './Sidebar';
import 'bootstrap/dist/css/bootstrap.min.css';
import TopArtistsView from './TopArtistsView';
import EditProfile from './EditProfile';
import PlaylistsView from './PlaylistsView';

function UserProfile() {
  return (
    <div className="container-fluid bg-white py-4">
      <div className="row">
        <div className="col-lg-9">
          <Routes>
            <Route path="/userprofile" element={[<ProfileHeader />, <TopArtists />, <Playlists />]} />
            <Route path="/userprofile/top-artists" element={<TopArtistsView />} />
            <Route path="/userprofile/playlist-view" element={<PlaylistsView />} />
            <Route path="/userprofile/edit-profile" element={<EditProfile />} />
          </Routes>
        </div>
        <div className="col-lg-3">
          <Sidebar />
        </div>
      </div>
    </div>
  );
}

export default UserProfile;
